    public class ColorRamp
    {
        public static Color GetColour(double v, double vmin, double vmax)
        {

            double dv = 0;
            double r = 0, g = 0, b = 0;
            if (v < vmin)
                v = vmin;
            if (v > vmax)
                v = vmax;
            dv = vmax - vmin;

            if (v < (vmin + 0.25 * dv))
            {
                r = 0;
                g = 4 * (v - vmin) / dv;
            }
            else if (v < (vmin + 0.5 * dv))
            {
                r = 0;
                b = 1 + 4 * (vmin + 0.25 * dv - v) / dv;
            }
            else if (v < (vmin + 0.75 * dv))
            {
                r = 4 * (v - vmin - 0.5 * dv) / dv;
                b = 0;
            }
            else
            {
                g = 1 + 4 * (vmin + 0.75 * dv - v) / dv;
                b = 0;
            }
            r *= 100;
            g *= 100;
            b *= 100;
            return Color.FromArgb((int)r , (int)g , (int)b);
        }

        //public static Color GetColour(int level, int rampID)
        //{

        //}
    }

    /// ________________________________________________________________________________
    /// <summary>
    /// Builds a SortedList of 256 RGB colours. The individual colour values are extracted
    /// from a string which contains red, green, and blue values for each of the 256 colours
    /// in the list. There are 22 ramps defined in a string array (RampStrings). The strings
    /// were sourced from data files presented in Bourke (1996) and correspond to the files
    /// 01.dat to 22.dat at that website. The strings used here are a re-arrangement of the
    /// format of the data presented in those files but are in every other respect identical
    /// to that data.
    /// 
    /// The website referenced below contains visual representations of the values used here. 
    /// 
    /// The content of the string is 'de-constructed' using the Split function of the Regex
    /// object. In this implementation the string values, after having been extracted from
    /// the source string, are supplied directly to one of the constructors in the RGB object
    /// but users of this code will need to re-cast that part of the code to suit their own
    /// particular needs.
    /// 
    /// ref:
    /// Bourke, Paul. 1996. Colour Ramping for Data Visualisation.
    /// http://ozviz.wasp.uwa.edu.au/~pbourke/texture_colour/colourramp/
    ///</summary>
    public class Ramp
    {
        #region DECLARATIONS
        private int _RampId;
        private SortedList _Colours;
        private System.Drawing.Color[] _Colors;
        #endregion

        #region CONSTRUCTORS
        /// ____________________________________________________________________________
        /// <summary>
        /// Constructs a Ramp object containing a colour list using the 'standard' ramp;
        /// i.e., ramp_id = 1.
        ///</summary>
        public Ramp()
        {
            _RampId = RAMPS.Standard;
            _Colours = EnlistColours(RAMPS.RampStrings[RAMPS.Standard]);
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Constructs a Ramp object containing a colour list using ramp_id to access the
        /// ramp string array. ramp_id is coerced to a valid index. If the supplied ramp_id
        /// is outside the valid range Ramp will contain either the first or the last defined
        /// ramp depending on whether ramp_id is below or above the valid range respectively.
        ///</summary>
        public Ramp(int ramp_id)
        {
            _RampId = Math.Min(Math.Max(ramp_id, RAMPS.MinId), RAMPS.RampCount);
            _Colours = EnlistColours(RAMPS.RampStrings[_RampId]);
            _Colors = new Color[_Colours.Count];
            for (int i = 0; i < _Colours.Count; i++)
            {
                _Colors[i] = (System.Drawing.Color)_Colours[i]  ;
            }
        }
        #endregion

        #region PROPERTIES
        public System.Drawing.Color[] Colors
        {
            get
            {
                return _Colors;
            }
            set
            {
                _Colors = value;
            }
        }

        /// ____________________________________________________________________________
        /// <summary>
        /// Gets the RampId. Note that the property is read-only. If you want a different ramp
        /// construct a new Ramp object supplying the desired ramp_id to the constructor.
        ///</summary>
        public int RampId
        {
            get { return _RampId; }
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Gets the list of colours.
        ///</summary>
        public SortedList Colours
        {
            get { return _Colours; }
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Gets the Values collection of the colours list.
        ///</summary>
        public ICollection IColours
        {
            get { return _Colours.Values; }
        }
        #endregion

        #region PRIVATE
        /// ____________________________________________________________________________
        /// <summary>
        /// Mediates the process of deconstructing the ramp definition string. The string
        /// must be fractionated in level order: the ID Level first followed by the colour
        /// definition level followed by the colour value level.
        ///</summary>
        private SortedList EnlistColours(string ramp_definition)
        {
            string colour_definitions_string = SplitIdLevel(ramp_definition);
            string[] colour_definitions = SplitDefinitionsLevel(colour_definitions_string);

            SortedList list = new SortedList(RAMPS.ColourCount);
            foreach (string colour_definition in colour_definitions)
                AddDefinition(colour_definition, list);
           
            return list;
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Splits ramp_definition on the colon character of which there is only one in
        /// the string. It separates the ramp ID from the colour definitions. The ID is
        /// ignored in this object but is included in the string for completeness and 
        /// to ensure that each ramp string is unambiguously associated with a data file
        /// as they are specified by Bourke (1996).
        ///</summary>
        private string SplitIdLevel(string ramp_definition)
        {
            ///parts[0] contains the ramp ID, parts[1] contains the ramp colour definitions.
            string[] parts = Regex.Split(ramp_definition, RAMPS.IdLevel);
            return parts[1];
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Splits ramp_definition on the semicolon character which results in an array
        /// of 256 colour definition strings.
        ///</summary>
        private string[] SplitDefinitionsLevel(string ramp_definition)
        {
            return Regex.Split(ramp_definition, RAMPS.ColourLevel);
        }
        /// ____________________________________________________________________________
        /// <summary>
        /// Splits colour_definition on the comma character which results in an array
        /// of 4 strings: colour ID, red value, green value, blue value.
        /// 
        /// colour_id is used as the key into the SortedList object and so must be
        /// converted to a numeric value to ensure that the list is sorted in the correct
        /// order. The other three values are passed as strings into the RGB object and it
        /// handles the conversion to suit itself.
        /// 
        /// Users of this code will probably want to re-cast this part of the code to
        /// suit the particular requirements of their own colour objects.
        ///</summary>
        private void AddDefinition(string colour_definition, SortedList list)
        {
            string[] parts = Regex.Split(colour_definition, RAMPS.RgbLevel);
            int colour_id = Convert.ToInt32(parts[0]);
            list.Add(colour_id,  System.Drawing.Color.FromArgb(int.Parse(parts[1]),int.Parse(parts[2]),int.Parse(parts[3])));
        }
        #endregion
    }

